"Place fillets in a single layer on a lightly greased or pan sprayed, shallow oven-to-table type broiler pan.  Brush with lemon juice.", "In a small bowl, combine remaining ingredients to make the cheese topping mixture.  Set aside.", "Broil fillets 4 to 6 minutes or until fish flakes easily when tested with a fork.  (Time will depend on the thickness of the fillets and temperature of your oven/broiler.).", "Remove fillets from oven.  Spread with Parmesan topping.", "Broil an additional 30 seconds or until cheese is lightly browned and bubbly (be careful to watch it, or it can burn).", 
"Garnish with lemon twists and parsley, if desired.", "Note:  Mushy cooked fish is a result of either 1) overcooking/overheating, or 2) over-marinating (which, science-wise, is another method of partial cooking, depending on the marinade). Since the flounder in the recipe is not marinated, if the fish comes out mushy I suspect the results are the from overcooking. Either the fish was left under the broiler for too long, the temperature of the broiler is too high, or the rack on which the the pan placed under the broiler is too close to the heat."
)

"Remove excess fat from chicken breasts; place them in sealable plastic bag or non-aluminum bowl.", "Combine remaining ingredients; pour evenly over chicken breasts.", "Seal bag or cover bowl; marinate in refrigerator 4 hours or overnight.", "Turn occasionally.", "Remove chicken from marinade, reserving marinade.", "Arrange in one layer in greased 9x13-inch pan.", "Pierce skin in several places with sharp knife.", "Cover with foil.", "Bake at 350°F for 30-35 minutes, or until mostly cooked through; in the mean time, bring reserved marinade to a simmer in a small saucepan, simmering 15 minutes.", 
"After main cooking time, uncover chicken and baste with marinade every 5 minutes until chicken is cooked through, approx 15-20 minutes.", "For OAMC or freezing ahead, freeze this chicken, raw, in marinade -OR- freeze after cooking, making sure to include a portion of the cooking juices with each breast (keeps chicken moist while thawing).", "Serving suggestions:  bed of rice or baby spinach; side of green salad with raspberry vinaigrette; mashed potatoes; steamed carrots or broccoli; sliced thin over a bed of peppered angel hair pasta."
)

"Blanch salt pork in boiling water 5 minutes.", "Drain and rinse well; pat dry.", "Transfer to heavy large skillet and cook over medium flame until lightly browned.", "Remove from skillet using slotted spoon and reserve for use in salads or other dished.", "Increase heat to medium high.", "Add beef to skillet in batches (do not crowd) and cook until well browned on all sides, turning with spatula.", "Transfer meat to heavy 2 to 3 quart saucepan.", "Add onions to skillet reduce heat slightly and cook until deep golden brown about 10 minutes, stirring occasionally.", 
"Blend in flour and cook about 30 seconds, watching carefully so flour does not burn.", "Add stout and stir, scraping up any browned bits.", "Bring mixture to boil.", "Pour over beef.", "Blend in vinegar, sugar, parsley, bay leaf and thyme.", "Cover saucepan and simmer mixture for 30 minutes.", "Spread mustard over bread.", "Press bread into stew.", "Cover and cook until meat is tender, about 1 hour.", "Remove bay leaf and discard.", "Serve immediately.", "Serve with boiled potatoes, green salad and beer."
)

"Combine cake flour and 1/2 cup of the sifted powdered sugar, set aside.", "In small mixer bowl beat egg yolks with electric mixer on high speed about 6 minutes or till thick and lemon coloured.", "Gradually add remaining powdered sugar, beating constantly about 4 minutes.", "Stir in orange peel.", "Wash beaters thoroughly.", "In large mixer bowl beat egg whites, vanilla, and cream of tartar till soft peaks form.", "Gently fold yolk mixture into whites.", "Sift flour mixture over egg mixture, 1/3 at a time and fold in gently.", 
"Turn into ungreased 9 inch tube pan.", "Bake in 325 degree oven about 55 minutes or till cake springs baack when lightly touched.", "Invert cake in pan, cool thoroughly.", "Remove from pan.", "With a long tined fork, poke holes in top of cake at 1 inch intervals.", "For syrup, in a saucepan combine orange juice and honey.", "Simmer 5 minutes.", "Remove from heat, stir in almond extract.", "Spoon syrup evenly over cake, a small amount at a time, allowing cake to absorb syrup.", "Chill, if desired."
