"Soak black beans in water overnight.", "The next day, drain and rinse before using.", "In a large saucepan or heavy bottom cooking pot, add 1/2 cup of broth, chopped onion and chopped garlic and bring to boil.", "Reduce heat; cover and simmer for 6 to 8 minutes.", "or until onions are jnst tender.", "Stir in black beans; add 2 cups water, diced potato, crushed plum tomatoes including liquid, thyme, cumin, green beans, and remaining broth; return to boil.", "Reduce heat, cover and simmer for 15 to 20 minutes or until potatoes are tender, stirring occasionally.", 
"Add shredded carrots, green and red peppers, chopped celery, Tabasco sauce and cook for an additional 5 minutes.", "Adjust seasonings to taste.", "Garnish each serving with chopped green onions.", "Refrigerate any unused portion.", "You may wish to add some low-sodium soy sauce to the soup, use about 2 tablespoons, however it will increase the sodium count.", "You can also use canned black beans to speed up the process.", "Use 2- 15 fluid ounce cans, drained and rinsed.", "Cauliflower florets would also enhance the soup, use about 1 cup of florets."
)

"Change the angle on the George Foreman meat cooking grill so it is level not tilted any more (I used the small George Foreman grill-- the one that cooks approximately 4 hamburgers).", "Use the spare legs or the drain tray upside down or similar method.", "Preheat the grill 5 minutes--use a timer.", "Combine all ingredients except the margarine or pam like spray.", "Grease both sides of the grill lightly with margarine (do not use butter in the grill--it will burn black and smoke).", "Pour the entire batter gently into the grill; smooth carefully.", 
"Close the grill.", "Wait a minute more or less until steaming slows down or stops.", "Open the grill and test with a toothpick to see if done.  If not done, close grill 10 to 30 seconds more.", "Open the grill and remove the tiger waffle.", "It will have golden brown and dark brown tiger stripes and be like a Belgian waffle but also a new taste and texture very moist.", "Good with syrup or hot fruit sauces or as part of a meal instead of potatoes or rice, pasta you know with a gravy or cream sauce."
)

"Scald 1 cup milk and slowly add 3/4 cup flour and beat thoroughly.", "Cool.", "Dissolve yeast in 1/4 cup warm milk, mix in 1 tbsp sugar.", "Add to the cooled flour mixture and beat well.", "Let rise until double in bulk (30 minutes).", "Add salt to eggs yolks and beat until thick and lemon colored.", "Add sugar, vanilla and almond extract and continue to beat.", "Add to sponge (flour-yeast mixture), add remaining flower.", "Knead for ten minutes.", "Add butter and knead 10 minutes or until dough no longer sticks to your fingers.", 
"Add fruit and nuts mix into dough, cover and let rise until double in bulk (60 minutes).", "Punch down and let rise again (60 minutes).", "Punch down.", "Butter a fluted tube pan and sprinkle with bread crumbs.", "Fill with dough to cover 1/3 of the pan.", "Let rise 1 hour* and bake at 350°F for 50 minutes.", "Cool and decorate with lucre.", "Lucre: Mix ingredients and spread over top of cake, letting it drip down the sides.", "Note- rising times are approximate.", "Keep dough covered in a warm place free from drafts."
)

"Dissolve yeast in warm water until dissolved.", "Add next three ingredients and beat well.", "Add egg and lard then stir.", "Mix in 3 1/2 cups of flour.", "Gradually add the rest of the flour  until dough is easy to handle.", "Place in large bowl.", "Grease top of dough and cover.", "Refrigerate until double.", "(May be left overnight and used early the next morning).", "Preheat oven to 375 degrees F.", "Punch down dough.", "Roll out 1/2 the dough into an oblong and butter well.", "Sprinkle w/ sugar and spice mix.", 
"Add fruit layer if you like.", "Roll up as a jellyroll.", "Place on large baking sheet and join ends together to form circle of dough.", "Using kitchen scissors, snip 2/3 way thru in 1 inch intervals.", "Turn sections until one sections lays on top of the next completing the ring.", "Let raise until double.", "Bake until 30 minutes or so until done.", "Using spatulas remove ring to seving plate while it is still very warm.", "Pour confectioners sugar glaze over warm ring and decorate w/ nuts, cherries etc."
